import React from 'react'

function Header() {
  return (
    <div className='header'>
      <img src='serikal.png' style={{float:"right",height:"90px", borderRadius:"60px",marginTop:"0px"}}/>
      <img src='police11.png' style={{float:"left" ,height:"90px", borderRadius:"50px", marginTop:"0px",width}}/>
      <h1>ONLINE REPORTING  EVENT SYSTEM </h1>
    </div>
  )
}

export default Header
